sys_variable_value.value:
(function execute(inputs, outputs) {

  gs.include("ethjs-account");

  var acct = ethAccount.generate(inputs.entropy);

  outputs.address = acct.address;
  outputs.publickey = acct.publicKey;
  outputs.privatekey = acct.privateKey;

})(inputs, outputs);

